import { twMerge } from "tailwind-merge";

export default function Services() {
  return (
    <div className={twMerge(["min-h-screen"])}>
      <h1 className={twMerge(["text-[2.8em]", "font-bold", "text-[#BC180C]"])}>
        การบริการ
      </h1>
      <h1
        className={twMerge([
          "text-[2em]",
          "font-bold",
          "text-[#BC180C]",
          "mb-5",
        ])}
      >
        (Service)
      </h1>
      <p className={twMerge(["max-w-2xs"])}>
        เรามีผู้เชี่ยวชาญด้านการวางระบบสารสนเทศ ออกแบบ จัดหา ติดตั้ง
        บริหารจัดการและซ่อมบำรุง โดยทีมงานผู้ชำนาญ
      </p>

      <div
        className={twMerge([
          "mt-5",
          "grid",
          "sm:grid-cols-2",
          "gap-3",
          "sm:max-w-3/5",
        ])}
      >
        {services.map((service, k) => (
          <Service key={k} index={k} service={service} />
        ))}
      </div>
    </div>
  );
}

const Service = ({ service, index }: { service: string[]; index: number }) => {
  return (
    <div className={twMerge(["bg-white", "p-5"])}>
      {icons[index]}
      <h4 className={twMerge(["font-bold", "mb-3", "mt-8"])}>{service[0]}</h4>
      <p>{service[1]}</p>
    </div>
  );
};

